import "./Skybox"
import { Canvas } from "@react-three/fiber";
import SkyBox from "./Skybox";
import "./Skybox.scss"
import "./App.css"
import * as THREE from 'three'
import { Stats, OrbitControls, PerspectiveCamera } from '@react-three/drei'
// import { Sky } from "@react-three/drei";

export default function App(props:any) {

   return (
      // <div> 
        <Canvas className="skybox" camera={{ position: [0, 0, 3] }}>
          <ambientLight />
          <mesh>
            <planeBufferGeometry attach="geometry" args={[25, 15]} />
            <meshPhongMaterial attach="material" color="grey" />
         </mesh>
          <SkyBox /> 
          <PerspectiveCamera position={[2, 2, 2]} makeDefault />
          <OrbitControls />

        </Canvas>
   );
}
